import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-f1e7afee.js";const o={},c=t("<p>《三命通会》卷 九·六癸日壬戌时断</p><p>六癸日生日壬戌，支内正官生财库；月兼有救贵多成，倚托若无终不富。</p><p>癸日壬戌时，水火既济，癸用丙丁为财，戊土为官，戊与癸合旺，为人智谋，通月气有倚托者贵；不通，平常；通火土月气，富贵双全；运气通，亦吉。</p><p>癸丑日壬戌时，刑，亥月，土厚地方上贵。</p><p>辰申年月，南方运，状元。</p><p>五月，南运，都宪。</p><p>若春秋生，南方运，八九品。</p><p>癸卯日壬戌时，日贵格，寅巳年月，干透戊丁财官而旺，大贵有权。</p><p>卯辰丑午子等年月，文贵。</p><p>酉戌，金土运，五六品。</p><p>癸巳日壬戌时，财官双美，春平，夏秋冬贵。</p><p>辰丑未寅酉年月，风宪。</p><p>癸未日壬戌时，刑。</p><p>巳月生，三四品。</p><p>子庚年月，近侍贵。</p><p>癸酉日壬戌时，亥子月，才智高贵，妻贤子孝。</p><p>春平常。</p><p>夏财官，秋印绶，俱吉。</p><p>辰丑，刑冲戌库，贵富两全。</p><p>戌月，东南运，武贵。</p><p>癸亥日壬戌时，春生，伤官见官，夏财旺，秋、冬吉，名利有成。</p><p>戌辰月，行亥子运，贵。</p><p>子月，行西南运，金紫。</p><p>天乙壬癸戌时排，库内财官等钥开；不遇刑冲空锁闭，少年难发更生灾。</p><p>癸日时逢壬戌，就中仓库盈余。</p><p>将星天德两相扶，辰戌钥匙开助。</p><p>土旺长流水局，六亲恩处成疏。</p><p>不遇空亡有增余，中末荣华享福。</p>",28),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","285卷 九·六癸日壬戌时断.html.vue"]]);export{f as default};
